import styled from 'styled-components';
import { Button } from 'antd';

export const SignUpBtn = styled(Button)`
  background-color: #617a55;
  color: white;
  border: none;

  &:hover {
    background-color: #F7E1AE;
    color: white;
    border: none;
  }
`;
